import {createApp} from 'vue'
import App from './App.vue'

createApp(App).mount('#app')
// import {login} from "@/utils/api";
// login("admin","admin")
import {post} from "@/utils/http"

//login

post("user/login", {
    createTime: "",
    id: 0,
    password: "admin",
    permissions: 0,
    updateTime: "",
    username: "admin"
}).then(res => {
    console.log(res);
}).catch(err => {
    console.log(err);
})
